import React from "react";
import styled from "styled-components";

export default function Navbar() {
  return (
    <MainContainer>
      <NavbarMainContainer>
        <LogoImg>
          <img
            src="/navbarimgcontainer/website_logo.png"
            alt="HouseHoldWebsite"
          />
        </LogoImg>
        <NavbarContent>
          <ul>
            <NavbarvContentContainer>
              <li>
                <a href="">Maintainance</a>
              </li>
              <InnerOptions>
                <li>electrical supply</li>
                <li>Watersupply</li>
              </InnerOptions>
            </NavbarvContentContainer>
            <NavbarvContentContainer>
              <li>
                <a href="">HouseHoldThings </a>
              </li>
              <InnerOptions></InnerOptions>
            </NavbarvContentContainer>
            <NavbarvContentContainer>
              <li>
                <a href="">Medical facilities </a>
              </li>
              <InnerOptions></InnerOptions>
            </NavbarvContentContainer>
            <NavbarvContentContainer>
              <li>
                <a href="">About</a>
              </li>
              <InnerOptions></InnerOptions>
            </NavbarvContentContainer>
          </ul>
        </NavbarContent>
      </NavbarMainContainer>
    </MainContainer>
  );
}

const MainContainer = styled.div`
  width: 100%;
`;

const NavbarMainContainer = styled.nav`
  width: 100%;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-between;
`;

const LogoImg = styled.div`
  width: 5%;
  padding: 4px;
  margin: 4px;

  img {
    width: 100%;
    filter: invert(100%);
  }
`;

const NavbarContent = styled.div`
  width: 100%;

  ul {
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-evenly;
    list-style: none;
  }
`;

const NavbarvContentContainer = styled.div`
  border: 2px solid pink;
  display: flex;
  flex-direction: column;

  li {
    font-family: "Alkatra", cursive;
    padding: 3px;
    margin: 5px;
    cursor: pointer;
    border-radius: 4px;
    text-align: center;
    background-color: white;
    width: 100%;
    a {
      text-decoration: none;
      color: #472d2d;
      font-size: 1.2rem;
      padding: 2px;
      box-sizing: border-box;
      width: 100%;
      letter-spacing: 0.3px;
      line-height: 5px;
    }
  }
`;
// css for inner option

const InnerOptions = styled.div`
  border: 2px solid green;
  display: flex;
  flex-direction: column;
  position: absolute;
  background-color: aqua;
  top: 20%;
`;
